import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

import data from './data.json';
import CardList from './components/CardList';
import CardInfo from "./components/CardInfo";
import Quotes from "./components/Quotes";

const quotes = "Store Laptop Harga Merakyat Kualitas Sultan";
const author = "@puput_we";


ReactDOM.render(
  <React.StrictMode>
    <App />
    <CardList data={data} />
    <CardInfo
    title="Promo 9.9 Harga Super MURAH"
    info="Cermati brosur kami ya dan bandingkan harganya, promo yang kami berikan benar benar termurah di Salatiga, 
    tidak percaya ? Silakan datang langsung ke Computer Sultan Store di RUKO Pancasila No 8, atau kunjungi Olshop kami di Shoppe : 33ComCenter"
    author={author}
    />
    <Quotes author="Me" quotes={quotes} />
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
